import React from 'react'

export default function Paragraph() {
  return (
    <div class="para-component">
    <h2>Are you aware of your rights?<br/>
    How well do you know the law?<br/>
    Is your knowledge regarding current affairs up-to date?</h2>
    <p>Staying informed and aware is essential to uphold justice in society. Every citizen carries the responsibility to be vigilant and proactive in understanding their rights and legal obligations.<br/>
    It is not only our responsibility, but also our duty.</p>
</div>
  )
}
